import PostList from "./PostList";
import Filter from "./filter/Filter";

function Main({setFilter, changePostListApi}) {
    return (
        <div>
            <Filter setFilter={setFilter}/>
            <PostList ref={changePostListApi}/>
        </div>
    )
}

export default Main;
